INSERT INTO `v1_416c5c6fedf2946956f7accf6eee1f458b75c8b46e17d3236b5cf92d07a10579` VALUES ("この蝋燭は、もしや君が作ったのか？\nなに、精油にそんな希少な成分を？\nわざわざぼくの誕生日を祝うために？\n後輩……君という子は……！", 11, 4, 111011, 0, 1110501, 1, 0, 1, "", 1110501043);
